import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to load
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Extract all product prices
    const prices = await page.$$eval('.product-price', priceElements => 
      priceElements.map(el => {
        // Get only the current price (ignore original price if present)
        const text = el.textContent;
        // Extract first price found (current price)
        const priceMatch = text.match(/\$\d+\.\d+/);
        return priceMatch ? priceMatch[0] : 'Price not found';
      })
    );

    // Take screenshot after extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_prices_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_prices_extracted.png'));

    return {
      success: true,
      action: "Extracted all product prices from the page",
      extractedData: {
        productPrices: prices,
        totalProducts: prices.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to extract product prices",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
